import React from 'react'
import { useHistory } from "react-router-dom";
function Formulario() {
    let history = useHistory();
    return (
        <div className="card text-center bg-dark">
            <div className="card-body text-light">
                <h4 className="card-title">Inicia Sesion:</h4>
                <form action="">
                    <input type="email" placeholder="Usuario"></input>
                </form>
                <button onClick={() => {history.push('/registro')}} class="btn btn-outline-secondary border-0 text-light ">Ingresar</button>
                <h4 className="card-title">Â¿Eres nuevo? Registrate:</h4>

                <button onClick={() => {history.push('/registro')}} class="btn btn-outline-secondary border-0 text-light ">Registrarse</button>
            </div>
        </div>
    )
}

export default Formulario
